    </div>
  )
}

const Part = (props) => {
  console.log(props)
  return (
    <p>{props.pt[0].name + " " + props.pt[0].exercises}
    <br/>
    <br/>
    {props.pt[1].name + " " + props.pt[1].exercises}
    <br></br>
    <br></br>
    {props.pt[2].name + " " + props.pt[2].exercises}
    <br></br>
    </p>
  )
}

const Content = (props) => {
  console.log(props)
  return (
    <div>
      <p>
        <Part pt={props.parts}/>
      </p>
    </div>
  )
}

const Total = (props) => {
  console.log(props)
  return (
    <div>
      <p>
      {"Number of exercises " + (props.count[0].exercises + props.count[1].exercises + props.count[2].exercises)}
      </p>
    </div>
  )
}

const Button = (props) => {
  return (
    <button onClick={props.handleClick}>
      {props.text}
    </button>
  )
}

const Display = (props) => {
  return (
    <div>{props.counter}</div>
  )
}

